import React, {Component} from 'react';
import classes from "./boardCard.css"

class BoardCard extends Component {
    render() {
        return (
            <div className={classes.boardCard}>
                <form action="">
                    <input type="text"/>
                    <input type="f"/>
                </form>
            </div>
        );
    }
}

export default BoardCard;
